class Triangle():
    def __init__(self, p1, p2, p3):
        self.p1=p1
        self.p2=p2
        self.p3=p3

    def __repr__(self):
        return "triangle: {} {} {}".format(self.p1.__repr__(), self.p2.__repr__(), self.p3.__repr__())

    def perimeter(self):
        return self.p1.distance(self.p2)+self.p1.distance(self.p3)+self.p2.distance(self.p3)

    def graph(self):
        triangle_title=self.__repr__()
        plot.title(triangle_title)
        plot.scatter([self.p1.X, self.p2.X, self.p3.X],[self.p1.Y, self.p2.Y, self.p3.Y])
        plot.show()

