def bubble_sort(lst):
    '''Requirements will sort a list containg integers
    in ascending order
    INPUT: list of integers
    OUPUT: sorted list of integers and runtime'''
    end= len(lst)
    while end &gt; 0:
        for i in range(0,end-1):
            if lst[i] &gt; lst [i+1]:
                lst[i], lst[i+1]=lst[i+1], lst[i]
        end -=1
    return lst

